import React from 'react';
import './PopCardStyles.scss';
import {withRouter} from 'react-router-dom';
import PopYTpage from '../../pages/pop-search-page/PopYoutubePage';

import { compose } from 'redux';
import { connect } from 'react-redux';
import { change_youtube_url } from '../../actions';

const mapDispatchToProps = dispatch => {
	return {
		change_youtube_url: (YTurl) => dispatch(change_youtube_url(YTurl))
	}
}

const PopCard = ({id, name, song, album, date, yt_url, history, match, change_youtube_url}) => {
	const linkUrl = 'pop_search_yt';
  const handleClick = (i) => {
    change_youtube_url(i);
    history.push(`${linkUrl}`);
  }

	return(
		<div className='dib br4 pa3 ma2 grow bw2 shadow-5 card-display'>
			<h2 className='song-font'>{song}</h2>
			<h3 className='singer-font'>by {name}</h3>
			<h4 className='album-font'>Album/Single: {album}</h4>
			<p className='realease-date'>Realease date: {date}</p>
			<button 
				className="box-container"
				onClick={() =>
					handleClick(yt_url)}
			>
				HIT THIS SONG
			</button>
		</div>
	)
}


export default compose(
  withRouter,
  connect(null, mapDispatchToProps)
)(PopCard);
